import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";
import BusinessCenterIcon from "@mui/icons-material/BusinessCenter";

const Cart2 = ({ data }) => {
  console.log(data);
  return (
    <Box className="Cart_2">
      <Box className="element">
        <Box>
        <BusinessCenterIcon />
        </Box>
        <Box>
          
        </Box>
        <Typography
          className=""
          gutterBottom
          variant="p"
          component="div"
        >
          {data}
        </Typography>
      </Box>
    </Box>
  );
};

export default Cart2;
